    private final PartidosDeBsAs partido;
    private final List<String> localidad;


    Localidades(PartidosDeBsAs partido, List<String> localidad) {
        this.partido = partido;
        this.localidad = localidad;
    }
    public PartidosDeBsAs getPartido() {
        return partido;
    }
    public List<String> getLocalidad() {
        return localidad;
    }
    public static List<String> getLocalidadPorPartido(PartidosDeBsAs partido){
        return Arrays.stream(values())
                .filter(l -> l.getPartido() == partido)
                .findFirst()
                .map(Localidades ::getLocalidad)
                .orElse(Arrays.asList());

    }
